template <
  const uint8_t k,
  const uint8_t eta1,
  const uint8_t eta2,
  const uint8_t du,
  const uint8_t dv,
  const uint32_t batch_size = 1>
__launch_bounds__(128) __global__ void test_pke_encrypt_kernel(
  const uint8_t ek[(384 * k + 32) * batch_size],
  const uint8_t m[32 * batch_size],
  const uint8_t r[32 * batch_size],
  uint8_t c[(32 * (du * k + dv)) * batch_size],
  Zq* A)
{
  if (blockIdx.x >= batch_size) { return; }
  A += blockIdx.x * 256 * k * k;
  ek += blockIdx.x * (384 * k + 32);
  m += blockIdx.x * 32;
  r += blockIdx.x * 32;
  c += blockIdx.x * (32 * (du * k + dv));
  pke::encrypt<k, eta1, eta2, du, dv>(ek, m, (uint64_t*)r, c, PolyMatrixView<256, k, k, Zq>(A));
}

class PkeEncryptTest : public IcicleTestBase
{
public:
  static const std::string TEST_DATA_PATH;
  static const size_t BATCH_SIZE;

  void SetUp() override
  {
    IcicleTestBase::SetUp();
    std::cout << "\nRunning tests with batch size: " << BATCH_SIZE << std::endl;
  }

  template <typename T>
  static void randomize(T* arr, uint64_t size)
  {
    // Fill the array with random values
    uint32_t* u32_arr = (uint32_t*)arr;
    for (int i = 0; i < (size * sizeof(T) / sizeof(uint32_t)); ++i) {
      u32_arr[i] = rand_uint_32b();
    }
  }

  static std::string voidPtrToHexString(const std::byte* byteData, size_t size)
  {
    std::ostringstream hexStream;
    for (size_t i = 0; i < size; ++i) {
      hexStream << std::hex << std::setw(2) << std::setfill('0') << static_cast<int>(byteData[i]);
    }
    return hexStream.str();
  }

  template <const uint8_t k, const uint8_t eta1, const uint8_t eta2, const uint8_t du, const uint8_t dv>
  void encrypt_test(
    const uint8_t* reference_ek, const uint8_t* reference_m, const uint8_t* reference_r, const uint8_t* reference_c)
  {
    const size_t ek_size = 384 * k + 32;
    const size_t c_size = 32 * (du * k + dv);
    const size_t m_size = 32;
    const size_t r_size = 32;

    uint8_t* d_ek;
    uint8_t* d_m;
    uint8_t* d_r;
    uint8_t* d_c;
    Zq* d_A;

    uint8_t h_c[c_size];

    // Allocate memory for 10 sets of inputs and outputs
    cudaMalloc(&d_ek, BATCH_SIZE * ek_size);
    cudaMalloc(&d_m, BATCH_SIZE * m_size);
    cudaMalloc(&d_r, BATCH_SIZE * r_size);
    cudaMalloc(&d_c, BATCH_SIZE * c_size);
    cudaMalloc(&d_A, BATCH_SIZE * PolyMatrixView<256, k, k, Zq>::byte_size());

    // Copy same inputs into each batch slot
    for (int i = 0; i < BATCH_SIZE; ++i) {
      cudaMemcpy(d_ek + i * ek_size, reference_ek, ek_size, cudaMemcpyHostToDevice);
      cudaMemcpy(d_m + i * m_size, reference_m, m_size, cudaMemcpyHostToDevice);
      cudaMemcpy(d_r + i * r_size, reference_r, r_size, cudaMemcpyHostToDevice);
    }
    cudaError_t err = cudaDeviceSynchronize();
    if (err != cudaSuccess) { printf("Copy failed with error \"%s\"\n", cudaGetErrorString(err)); }

    // Launch 10 threads, one per batch element
    test_pke_encrypt_kernel<k, eta1, eta2, du, dv, BATCH_SIZE><<<BATCH_SIZE, 128>>>(d_ek, d_m, d_r, d_c, d_A);

    err = cudaDeviceSynchronize();
    if (err != cudaSuccess) {
      printf("error code: %d, Kernel launch failed with error \"%s\"\n", err, cudaGetErrorString(err));
    }

    // Copy back each output ciphertext

    for (int j = 0; j < BATCH_SIZE; ++j) {
      cudaMemcpy(h_c, d_c + j * c_size, c_size, cudaMemcpyDeviceToHost);
      for (int i = 0; i < c_size; ++i) {
        if (h_c[i] != reference_c[i]) {
          printf("Mismatch at byte %d in batch %d: %d != %d\n", i, j, h_c[i], reference_c[i]);
          EXPECT_EQ(h_c[i], reference_c[i]);
          return;
        }
      }
    }

    cudaFree(d_ek);
    cudaFree(d_m);
    cudaFree(d_r);
    cudaFree(d_c);
    cudaFree(d_A);
  }
};

